import React from 'react';

import { BannerContainer, BannerTextBackgroundGreen, BannerTextBackgroundYellow, BannerTextBackgroundRed, BannerText } from './banner.styles';
import { CustomButton } from './../custom-button/custom-button.component';


const Banner = () => (
  <BannerContainer>
    <BannerTextBackgroundRed>
      <BannerText>GET A FREE STEREO MASTER</BannerText>
      <CustomButton>SIGN UP TODAY!</CustomButton>
    </BannerTextBackgroundRed>
    <BannerTextBackgroundYellow>
      <BannerText>Download Pricing to Lock in Rates!</BannerText>
      <CustomButton>Get Price Guide</CustomButton>
    </BannerTextBackgroundYellow>
    <BannerTextBackgroundGreen>
      <BannerText>Fresh Beats for Sale!</BannerText>
      <CustomButton>Click to Listen</CustomButton>
    </BannerTextBackgroundGreen>
  </BannerContainer>

);

export default React.memo(Banner);
